#!/usr/bin/python

import unittest
import MinSkew


class MinSkewTest(unittest.TestCase):

    def testData1(self):
        genome = 'TAAAGACTGCCGAGAGGCCAACACGAGTGCTAGAACGAGGGGCGTAAACGCGGGTCCGAT'
        expect = '11 24'
        self.assertEqual(expect, MinSkew.MinSkew(genome))

    def testData2(self):
        genome = ''
        expect = '89969 89970 89971 90345 90346'
        self.assertEqual(expect, MinSkew.MinSkew(genome))

    def testData3(self):
        genome = ''
        expect = '1857'
        self.assertEqual(expect, MinSkew.MinSkew(genome))


class MaxSkewTest(unittest.TestCase):

    def testData1(self):
        genome = 'GATACACTTCCCAGTAGGTACTG'
        expect = '1 2 3 4'
        self.assertEqual(expect, MinSkew.MaxSkew(genome))


if __name__ == '__main__':
    unittest.main()

